import React from 'react';
import HmDash from './Hm/Main';
import 'moment/locale/fr';
import moment from 'moment';
import './Loading.css';

import { doc, onSnapshot } from "firebase/firestore";
import { db } from '../../firebase';


// Return Home Admin
function App() {

 const [prix, setPrix] = React.useState([]);
 React.useEffect(async () => {
  try {
   onSnapshot(doc(db, "muungano", "emoney"), (doc) => {
    setPrix(doc.data().cdf);
   });
  } catch {
   window.console.log('erreur disponible')
  }

 }, []);

 [...Array(moment().date()).keys()].map(index => {
  value = index;
  value += 1;
  return (window.console.log(prix[value]))
 })


 return (
  <HmDash />
 );
};

// Export component Main 
export default App;
